import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import Home from './Pages/Home';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="bg-white">
        <Navbar />
        <Switch>
          <Home />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
